import React from 'react'
import './App.css'
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"

function App() {
  return (
    <Router>
      <div className="app">
        <Switch>
          <Route path='/checkout'>
            <h1>Checkout Page</h1>
          </Route>
          <Route path=''>

          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
